function HomePage(state, action) {
  switch (action.type) {
    case "SCROLLED":
      return { scrolled: true };
    case "NOT_SCROLLED":
      return { scrolled: false };
    default:
      return state;
    case "SHOW_LOGIN":
      return { login: true };
    case "HIDE_LOGIN":
      return { login: false };
  }
}

const reducer = {
  HomePage,
};

export default reducer;
